INSERT INTO `pt_petitions` (`petition_id`, `petition_uid`, `category_id`, `user_id`, `petition_title`, `petition_target`, `petition_image`, `petition_url`, `petition_description`, `petition_signed_count`, `petition_share_count`, `petiton_viewed_count`, `petition_goal`, `petition_status`, `created_date`, `last_updated`) VALUES
(2,	'5da406391a677',	7,	2,	'Children demand Declaration of a National Climate Emergency and Tackling of Climate Change',	'text',	'Pad2.jpg',	'https://callupon.org/stc',	'<p><strong>Record-breaking heat waves</strong> have become a regular occurrence in India, killing thousands of people. Melting snow-caps are slowly increasing the sea level.</p>\r\n<p><strong>Rainfall patterns in India are changing</strong>, and this has had a devastating effect on farmers’ harvests and affecting the migration patterns of different birds and animals.</p>\r\n<p><strong>The hottest days of the year will grip much of central and northern India</strong> in the coming days, and this heat wave is unlikely to end anytime soon.</p>\r\n<p><strong>Dust-storms and increased levels of air pollution</strong> - these seem to have become the normal way of living for most of us.\r\nI am a class 11 school student, and being a nature enthusiast, I know what<strong>repercussions several years of ignorance towards global warming</strong> will have for India in the long run.</p>\r\n<p>The human race has already caused irreversible climate change, the impacts of which are being felt around the world. <strong>But it’s not too late.</strong></p>',	0,	4,	0,	3000,	2,	'2019-10-14 05:23:05',	'2020-02-07 16:28:52'),
(5,	'5da40852c4d02',	5,	2,	'Stop Renting Forts in Maharashtra',	'text',	'pad5.jpg',	'https://callupon.org/stf',	'<p> The Forts in Maharashtra depict the valour of great leaders like Chhatrapati Shivaji Maharaj and our glorious history. However the Government of Maharashtra has decided to convert these forts Heritage Hotels and Wedding Venue.</p>\r\n<p> Strongly oppose Maharashtra Governments decision of converting Forts into Heritage hotels and wedding venues. The forts in our state need to be preserved and made history museums of global standards. </p>\r\n<p> I urge every one of you to sign this petition asking the Government of Maharashtra to withdraw this decision. </p>',	0,	0,	0,	3000,	2,	'2019-10-14 05:32:02',	'2019-12-10 10:22:16'),
(19,	'5dae97bd39830',	2,	9,	'Commit to Clearing Up Ghazipur Landfill #CleanTheMess',	'Text',	'TDRYYLbcAjrTDnv-800x450-noPad[1].jpg',	'https://callupon.org/stt',	'<p>Every Indian dreams of a house with a view of the mountains. But the view we have every single day is nothing less than a nightmare. We live in a skyscraper overlooking <strong>the Mount Everest of garbage dumps: Ghazipur, a massive landfill</strong> where all of Delhi’s garbage gets dumped. One news article we read says the landfill is spread <strong>as wide as</strong> <strong>29 football fields</strong> and is nearly <strong>as high as the Qutab Minar</strong>.</p>\r\n\r\n<p>While the Qutab Minar is a breathtaking monument, the <strong>towers of trash </strong>at Ghazipur are making residents in surrounding areas like us gag and hold our breath.</p>\r\n\r\n<p>The stench of rotting waste is <strong>releasing poisonous gases making everyone sick</strong>. We can’t even open our windows without vomiting. The toxic air has ruined our air purifiers and caused pipe leakages. Think of what it is doing to our bodies. It’s been <strong>17 years</strong> <strong>since Ghazipur ran out of space and should have been shut down but the trucks continue to dump waste there</strong>. Two years ago, a part of this <strong>landfill collapsed</strong>, <strong>killing 2 people</strong>. And still <strong>no action.</strong></p>\r\n\r\n<p>How can a mountain of garbage of such great proportions be <strong>invisible to our civic authorities</strong>. Save us from this <strong>ticking time bomb.</strong></p>\r\n\r\n<p>We have started this petition because we are sick of falling sick. We are sick of the inaction by authorities. <strong>We had given up all hope until we read about an IAS officer in Indore who was covered by the media for clearing up a similar but much smaller landfill under his jurisdiction in 6 months!</strong></p>\r\n\r\n<p>It gave us an idea of starting this campaign. We’re <strong>asking municipal authorities  to bring in IAS officer Asheesh Singh to hold technical consulting workshops for Municipal Corporation workers in Delhi to initiate the process of transforming Ghazipur landfill into a clean, green patch of land.</strong></p>\r\n\r\n<p>Help us <strong>green this landfill</strong> which is not only a health hazard for us citizens, but a blot on the<strong> global image </strong>of our national capital Delhi and on our collective vision of <strong>Swachh Bharat.</strong></p>\r\n',	0,	0,	0,	50000,	2,	'2019-10-22 05:46:37',	'2020-02-07 16:34:39'),
(20,	'5db0058a8c88e',	2,	1,	'NBCC submits revised plan to complete Jaypee projects',	'Plan',	'cons.jpg',	'https://callupon.org/stu',	'<p>The National Buildings Construction Corporation (NBCC) on October 17 submitted a revised proposal to complete the stalled projects of Jaypee Infratech. The proposal was later handed back to the NBCC counsel</p>   \r\n<p>The homebuyers\' counsel urged the top court to share a copy of the NBCC proposal with them.</p>   \r\n<p>   \r\nMeanwhile, the Jaypee Group has moved the Supreme Court against the National Company Law Appellate Tribunal (NCLAT) order that barred its parent company Jaypee Associates from bidding for Jaypee Infratech (JIL). The realtor urged the SC hear its plea seeking to consider its own proposal on the project.</p>   \r\n<p>   \r\nThe top court said it will hear the Jaypee Group plea on October 22, and extended the status quo on its insolvency proceedings till then.</p>   \r\n<p>   \r\nOn August 2, the Supreme Court had ordered a two-week status quo on Jaypee Group\'s plea against the NCLAT order after it was informed that Parliament had passed the proposed amendments to the Insolvency and Bankruptcy Code (IBC).</p>   \r\n<p>   \r\nOn July 30, the NCLAT had extended JIL\'s resolution process by 90 days, thereby allowing submission of fresh bids for the bankrupt realty company.</p>   \r\n<p>   \r\nThe Tribunal said the process of bidding and approval of a resolution plan by the Committee of Creditors (CoC) should conclude in 45 days.</p>   \r\n<p>   \r\nThe 90-day extension comes amid the lenders\' request to exclude around 250 days, from September 17, 2018 to June 4, 2019, from the stipulated period for the insolvency resolution process, as during this period no bid could be voted upon in view of the confusion regarding homebuyers\' voting rights.</p>   ',	0,	0,	0,	1900,	2,	'2019-10-23 07:47:22',	'2020-02-07 16:32:53'),
(21,	'5db006a87a0c5',	5,	1,	'Chennai: Bucking economic slowdown, developer to take 350 to employee',	'text',	'itparkcity.jpg',	'https://callupon.org/stv',	'<p>   \r\nA red London double-decker bus passes the London Eye on Westminster Bridge .   \r\n</p>   \r\n<p>   \r\nCHENNAI: Not all real estate developers are cribbing about the sluggish market. A Chennai-based developer, Casagrand, which has been able to clock sales of Rs 1,800 crore per annum even during the current slump, is sending 350 of its top performing employees to the UK on a five-day company-sponsored holiday trip.   \r\n</p> \r\n<p>   \r\nArun Kumar, MD of the company, has been personally organising junkets for his top-performing employees since 2013. “I have taken them to Singapore, Thailand, Sri Lanka, Dubai and Malaysia. In between, we skipped one year as we missed the sales target. People above the assistant manager-level and those who have completed three years of service are eligible for this paid holiday,” said Kumar.</p>\r\n<p>  \r\nThe company had proposed to take about 500 employees this year for achieving sales of Rs 1,800crore and collection of Rs 1,800crore in the last financial year, but many failed to get visa on account of eligibility issues, he said.   \r\nGowtham Aggarwal, senior VP of Casagrand, said a company-sponsored holiday gives opportunity to scores of people who would not have even dreamt of flying abroad. “Not all can afford a personal holiday. When the company takes them abroad on holiday, it motivates them to perform better in future. As they get recognised by the company, they gain a lot of respect from their family members. In turn, their respect for the company also goes up,” said Aggarwal.</p>\r\n<p>   \r\nIn terms of rewarding loyal and high-performing employees, none can perhaps beat Surat-based diamond merchant Savji Dholakia, who gifted Mercedes Benz SUVs worth Rs 1crore each to three of his employees last year for completing 25 years of service in his Hari Krishna Exports, which clocks more than Rs 6,000crore turnover per annum. Dholakia had gifted 500 flats and 525 pieces of diamond jewellery to his employees during 2014 Diwali as bonus. Two years later, he gifted 1,260 cars and 400 apartments to top performing employees.   \r\n</p>   \r\n<p>   \r\nCasagrand’s sops to its employees have been announced on a day international real estate consultant Knight Frank, FICCI and National Real Estate Development Council brought out a report saying the sentiments of home buyers plummeted to demonetisation level in the July-September quarter despite a slew of measures taken by the Central government and the RBI to improve investor confidence.</p>\r\n<p>  \r\nAs per the report, even the future outlook for the next six months has turned pessimistic for the first time since the end of 2013. The sector is under immense pressure. The overall economic slowdown and the slump in domestic consumption</p>',	0,	0,	0,	1800,	1,	'2019-10-23 07:52:08',	'2019-12-10 11:52:59'),
(25,	'5db0395b808f1',	2,	1,	'Everyone is free to live their life on way but why society give pressure',	'Barriers free society',	'',	'https://callupon.org/stz',	'Hi I want to create a barriers free society',	0,	0,	0,	2147483647,	2,	'2019-10-23 11:28:27',	'2020-02-07 16:33:06'),
(27,	'5db047fc6e8cb',	7,	21,	'Google touts quantum computing milestone',	'Google touts quantum computing milestone',	'google.jpg',	'https://callupon.org/stB',	'<p>\r\nGoogle said it has achieved a breakthrough in quantum computing research, saying an experimental quantum processor has completed a calculation in just a few minutes that would take a traditional supercomputer thousands of years.</p>   \r\n<p>\r\nThe findings, published on Wednesday in the scientific journal Nature, show that \"quantum speedup is achievable in a real-world system and is not precluded by any hidden physical laws,\" the researchers wrote. </p>  \r\n<p>\r\nQuantum computing is a nascent and somewhat bewildering technology for vastly sped-up information processing. Quantum computers might one day revolutionise tasks that would take existing computers years, including the hunt for new drugs and optimising city and transportation planning. </p>  \r\n<p>  \r\nThe technique relies on quantum bits, or qubits, which can register data values of zero and one — the language of modern computing — simultaneously. Big tech companies including Google, Microsoft, IBM and Intel are avidly pursuing the technology.  </p> \r\n<p>  \r\n\"Quantum things can be in multiple places at the same time,\" said Chris Monroe, a University of Maryland physicist who is also the founder of quantum startup IonQ. \"The rules are very simple, they\'re just confounding.\" </p>  \r\n   \r\n<strong>What\'s a quantum computer?</strong>   \r\n   <p>\r\nDescribing the inner workings of a quantum computer isn’t easy, even for top scholars. That’s because the machines process information at the scale of elementary particles such as electrons and photons, where different laws of physics apply. </p>  \r\n   <p>\r\n“It’s never going to be intuitive,” said Seth Lloyd, a mechanical engineering professor at the Massachusetts Institute of Technology. “At this microscopic level, things are weird. An electron can be here and there at the same time, at two places at once.”   </p>\r\n   <p>\r\nConventional computers process information as a stream of bits, each of which can be either a zero or a one in the binary language of computing. But quantum bits, known as qubits, can register zero and one simultaneously.  </p> \r\n   <strong>\r\nWhat can it do?   </strong>\r\n   <p>\r\nIn theory, the special properties of qubits would allow a quantum computer to perform calculations at far higher speeds than current supercomputers. That makes them good tools for understanding what’s happening in the realms of chemistry, material science or particle physics.  </p> \r\n   <p>\r\nThat speed could aid in discovering new drugs, optimizing financial portfolios and finding better transportation routes or supply chains. It could also advance another fast-growing field, artificial intelligence, by accelerating a computer’s ability to find patterns in large troves of images and other data.</p>\r\n ',	0,	6,	0,	25000,	2,	'2019-10-23 12:30:52',	'2019-12-10 12:04:56'),
(31,	'5db1401fe6535',	6,	21,	'Diwali 2019: Puja muhurat, date and significance',	'Diwali 2019: Puja muhurat, date and significance',	'diwali.jpeg',	'https://callupon.org/stF',	'<p><strong >Deepawali, Deepavali or Diwali</strong>is the festival of lights is one of the most awaited festivals, associated with the Legend of Lord Ram symbolizing the victory of righteousness and the lifting of spiritual darkness. Usually, the celebrations of the festival start with cleaning houses and workplaces and decorating them with lamps and lights, flowers and rangolis. This year Diwali will be celebrated on Sunday, October 27, 2019.</p>\r\n\r\n<p>The five-day-long celebrations will start on<strong>October 25</strong>onwards with Dhanteras. Chhoti Diwali which is also known as Narak Chaturdasi on<strong>October 26</strong>, followed by Diwali on<strong>October 27</strong>the main festival is celebrated. On<strong>October 28</strong>is the Govardhan Puja and at last, the festival concludes with Bhai Dooj on<strong>October 29</strong>.</p>\r\n',	0,	0,	0,	1200,	2,	'2019-10-24 06:09:35',	'2019-12-10 11:42:54'),
(71,	'5e32bed76732b',	2,	28,	'Does the server you use, protects your business or leads it towards Cyber Crime – DDoS',	'Does the server you use, protects your business or leads it towards Cyber Crime – DDoS  on social media',	'anti-attacks.jpg',	'http://petition.sheenz.in/bj',	'<strong>Does the server you use, protects your business or leads it towards Cyber Crime – DDoS Servers</strong><br />\r\n<p>It is natural that risk of cyber-attack is associated with each step taken by the world into the era of the digital age. Owing to this, such a risk has also become a bit daunting threat as well. Thus, with the rising risk of the cyber-attacks, (DDoS Protected Dedicated Servers) are receiving superior attention in the past few years abreast with a good reason of existence. Therefore, a DDoS attack is just an attempt in making unavailability of online service by overwhelming it via traffic from multiple sources.</p><br />\r\n<strong> DDoS Protected Dedicated Servers are so concerning? </strong><br />\r\n<p>The fundamental answer to reflecting such a concern is that such servers are relatively easy to implement. So, with the help of such servers, botnets could be easily purchased from the black market for better use of DDoS. </p><br />\r\n<p>Potential outcomes from DDoS attacks are listed below: </p><br />\r\n•    Operational Activities Interruption <br/><br />\r\n•    Financial impacts because of revenue, productivity and data loss <br/><br />\r\n•    Funding decreased ability and reputation damage <br/><br />\r\n<p>Alongside this, there are a large number of the additional fraud activities as well for which most of the cybercriminals make use of the DDoS to have access to the information which they really try to get on their hands. </p><br />\r\n<p>On the contrary, when it comes to the types of business, the attackers of DDoS never discriminate on it. It means that your business is not immune to such kind of activity. Therefore, there are a lot of industries that are receiving such kind of increasing attention with help DDoS attacks. Some of which are mentioned below: </p><br />\r\n•    Healthcare <br/><br />\r\n•    Hospitality <br/><br />\r\n•    Federal Government <br/><br />\r\n•    Local Government <br/><br />\r\n•    K-12 Education <br/><br />\r\n<strong>Alongside this, a question here arises that: <br/><br />\r\nHow to Protect Your Business from DDoS Attack? </strong><br />\r\n<p>The attackers of DDoS can attack the occupation at any point in time. No matter what industry are you in? You just need to keep below-listed recommendations so as to protect your business from DDoS attacks<br />\r\nKnow your security concerns and create a defensive strategy:<br/><br />\r\nIn order to assure that your business is completely safe and protected from DDoS attacks, you just need to develop the security policy of IT. One such security gets developed, be sure to share it with personnel of all the companies and assure that you have a secure network.<br/> <br />\r\nUp-to-Date Security Safeguards: <br/><br />\r\nTo defend your system from DDoS attack in all the best possible ways, it is mandatory that all your hardware, software, as well as other security safeguards, are up to date. Apart from this, strict password policies are often paramount and mandatory in keeping your systems secure. Thus, below-listed points would help you in developing all forms of business-related passwords such as: </p><br />\r\n•    Create a unique password for each account <br/><br />\r\n•    Create a password with a blend of letters, numbers, and symbols <br/><br />\r\n•    Never use common words and personal information <br/><br />\r\n•    Update and change your password on equal time intervals <br/><br />\r\n<strong>Concentrate on Network Security</strong><br />\r\n<p>Concentrating on the concerns of your network security, it’s better to keep in a touch with a network security specialist who consists of the knowledge and years of experience with cybersecurity. This is because his assistance holding such of the specialities would be highly able to give compete for network security at times as per the needs of the people and end-users. <br/><br />\r\nSo, what if a DDoS Attack Happens to Your Business? What to do in such a case? <br/><br />\r\nPrepare yourself to know that defending your business from DDoS attacks will not stop with mitigation and prevention. Therefore, it is very mandatory for your business to include a response plan as a member of its defence strategy. Having such kind of plan would help you rebound faster from the attacks.<br/><br />\r\nIn addition to this, it is also suggested to work with your ISP to see if they offer DDoS protection services so that if an attack occurs in a near-future then, you may let them know and they may reroute the traffic from a site prior to substantial damage is done. </p><br />\r\n<p>So, always assure that, whenever DDoS attacks are found to be on the rise, all such steps must be taken into consideration in order to mitigate the associated risks of these attacks. Also, note that no one in the world is so immune towards the cyber-attack. So, it’s better to always be ready and prepare yourself accordingly for the damaging cyber-attack.</p><br />\r\n ',	0,	0,	0,	4500,	1,	'2020-01-30 11:32:39',	'2020-01-30 17:02:39'),
(32,	'5db141351c798',	1,	21,	'Fact Check: Truth behind viral post of the largest snake killed in Amazon',	'Did Africa’s Royal British commandos kill the world’s largest anaconda which was 134 feet long and weighed more than 2,000 kilos? Did they take 37 days to kill the snake that had devoured over 250 humans and 2,300 animals?',	'snake_cover.jpeg',	'https://callupon.org/stG',	'<p>Did Africa’s Royal British commandos kill the world’s largest anaconda which was 134 feet long and weighed more than 2,000 kilos? Did they take 37 days to kill the snake that had devoured over 250 humans and 2,300 animals?</p>\r\n\r\n<p>Facebook user Ramakant Kajaria posted a picture of a humongous snake in a forest and onlookers surrounding it. The viral claim along with the picture says, World’s biggest snake Anaconda found in Africa’s Amazon river. It has killed 257 human beings and 2325 animals. It is 134 feet long and 2067 kgs. Africa’s Royal British commandos took 37 days to get it killed.</p>\r\n\r\n\r\n<p>India Today Anti Fake News War Room (AFWA) has found the claim to be wrong. Not only is the viral image photoshopped, but the entire information associated with it is cooked up and far from facts.\r\n\r\nThe viral post is being shared on social media for the past few years. Though Ramakant Kajaria posted the claim in 2015, it is still being shared by many. Till the filing of this story, the post was shared more than 1,24,000 times</p>\r\n\r\n<p>The viral image is poorly photoshopped. The fuzzy edge of the creature gives a clear impression that this is a manipulated picture. With the help of reverse image search, the original image of the snake can be found on the internet.</p>\r\n\r\n<p>Going by the claim and the image, it is certain that the viral post is an absolutely a cooked-up story passed off on social media over the years.\r\nThere have been several similar videos and images doing the rounds on the Internet over the largest snake in the world. International fact-check organisation Snopes had earlier debunked this claim.</p>',	0,	0,	0,	1212,	2,	'2019-10-24 06:14:13',	'2020-02-07 16:36:45'),
(68,	'5def472ed09d3',	4,	33,	'Ban Donald Trump : How to sign the petition asking the government to refuse the Republican candidate entry',	'econamic',	'trump-pa.jpg',	'http://callupon.org/bg',	'<p><strong>More than 100,000 people have signed </strong>a petition asking the Home Office to prevent presidential hopeful Donald Trump from entering the UK.</p>\r\n<p>As of Wednesday afternoon, more than 200,000 people had signed it, which means the issue will be debated in the House of Commons</p>',	5,	0,	0,	1000,	1,	'2019-12-10 07:20:14',	'2020-02-07 16:14:59'),
(33,	'5db147095c379',	2,	50,	'Delhi Pollution',	'No Crackers On Diwali !',	'images.jpg',	'https://callupon.org/stH',	'<p>Delhi has been suffering from a severe air pollution issue from last few years now and air quality is degrading ever then. The capital of India is known as the top most polluted cities in the world. Despite this fact, in one of the main festivals of India, Diwali, crackers add more to this problem. AIQ(Air quality index) has been \'very poor\' since late October 2018 and a life-sucking haze has engulfed the capital.</p>\r\n\r\n<p>To stop this, Supreme Court of India has banned \"harmful\" crackers and replaced them with \"green\" crackers.</p>\r\n\r\n<p><strong>Green crackers are still crackers which will cater to noise and air pollution during this festival season</strong>. General public will somehow exceed the time limit set for the bursting of crackers and history of India\'s polluted festival will repeat itself.</p>\r\n\r\n<p>After effects of crackers after diwali includes these following consequences :</p>\r\n\r\n<ol>\r\n	<li>Human health</li>\r\n	<li>Animal health</li>\r\n	<li>Noise pollution </li>\r\n	<li>Air pollution </li>\r\n	<li>Accidents during burning crackers</li>\r\n	<li>Decrease in visibility due to which, increase in accidents </li>\r\n	<li>Burning eyes and what not</li>\r\n</ol>',	0,	4,	0,	5000,	2,	'2019-10-24 06:39:05',	'2019-12-10 11:55:44'),
(34,	'5db14d53e4fdf',	4,	50,	'Un-employment Rate Downfall',	'Economy Awareness',	'download.jpg',	'https://callupon.org/stI',	'<p><b>Unemployment</b> occurs when workers who want to work or are seeking jobs are unable to find jobs, which means lower economic output, while still requiring maintainence. High rates of unemployment are a signal of economic crisis, but extremely low rates of <b>unemployment</b> may signal an overheated economy.</p>\r\n<p>\r\nAccording to official data, India’s unemployment rate stood at 6.1% in FY18, signaling the challenge that confronts the Narendra Modi-led government. The data isn’t comparable with that of last few years, the government contended, in effect seeking to refute previous leaked reports that said they showed the unemployment rate was at a 45-year high.</p>\r\n\r\n<p>\r\nThe Periodic Labour Force Survey (PLFS) of the National Sample Survey Office (NSSO) released 18th Oct, 2019 showed the unemployment rate in the country.</p>',	0,	1,	0,	5000,	2,	'2019-10-24 07:05:55',	'2019-12-10 12:00:09'),
(70,	'5def4ecbacf5e',	5,	33,	'TTIP : Three million people sign petition to scrap controversial trade deal',	'It will be presented to the European Commission in a few days',	'TTIPimage.jpg',	'http://petition.sheenz.in/bi',	'<p>A petition demanding an end to the secret Transatlantic Trade and Investment Partnership (TTIP) has reached three million signatures.</p>\r\n<p>The petition is against the controversial EU-US free trade deal and a similar deal between the EU and Canada called CETA. Both deals promise to increase trade by reducing regulatory barriers between trading partners.</p>\r\n<p>But critics point out TTIP’s threat to EU food and environmental safety laws as well as the sovereignty of national governments, which could be sued by corporations in secret tribunals called Investor-State Dispute Settlements (ISDS).</p>\r\n<p>The petition against the deals was launched a year ago by the ‘Stop TTIP’ campaign, a coalition of NGO’s, trade unions and consumer groups.  It reached 3,007,065 signatures this morning, over 500,000 of which came from the UK.</p>\r\n<p>The appeal, which will be presented to the European Commission in a few days, states: “We want to prevent lowering of standards concerning employment, social, environmental, privacy and consumers and the deregulation of public services (such as water) and cultural assets from being deregulated in non-transparent negotiations.”</p>\r\n',	0,	0,	0,	500,	1,	'2019-12-10 07:52:43',	'2019-12-10 13:26:31'),
(43,	'5db16baeb50e9',	5,	1,	'Removal of political party system in india',	'The whole people of india',	'',	'https://callupon.org/stR',	'<p>To remove poverty , unemployment and all the black money political party system should be remove in that place bureucratic type of government should be there in india.</p>',	0,	0,	0,	1,	2,	'2019-10-24 09:15:26',	'2020-02-07 16:34:59'),
(67,	'5def4205842e8',	5,	33,	'Sensitivity Training for Hyderabad City Police to Ensure Citizen Safety #PolicingWithLove',	'Text',	'police.jpg',	'http://petition.sheenz.in/bf',	'<p>As an Indian woman who is desperately looking for reassurances from society and our police system that I have nothing to be scared about after what happened to the Hyderabad vet in late November, I’m sorry to say that I feel worse by the day.</p>\r\n<p>\r\nI don’t want to feel this way and nor does any other person. So I’ve started this petition to demand a solution in light of the injustices that the victim’s family experienced when they went to the police for help.</p>   \r\n<p>   \r\nWhile a minister said that the victim should have called the police instead of her family in her final call, the fact of the matter is that the same police refused to cooperate with her anxious family.</p>    \r\n<p>   \r\n“I am scared,” were her last words to her sister. As soon as the victim’s sister received this message and found her phone had been turned off, the family rushed to the police. And then 3 unforgivable things happened.</p>   \r\n<p>   \r\nThe police on duty refused to file an FIR, and told the family to wait, despite knowing that the victim’s last words were of fear.   \r\nThey engaged in what can only be called moral policing by jumping to the conclusion that the “girl may have eloped with somebody”   \r\nThe police on duty refused to file a complaint saying it didn’t fall under their jurisdiction.</p>   \r\n<p>   \r\nIf this is the kind of support citizens are going to get from the police, then society is in trouble. And it’s each one left to fend for themselves.</p>   \r\n<p>   \r\nI’m sure the Hyderabad vet’s family feels betrayed. Police are supposed to be the first responders. As citizens we expect empathy and rapid action from them. Not dilly-dallying, judgmental theories and evasion of duty.</p>   \r\n<p>   \r\nThe police in question should be asked to public apologise for making the family run from pillar to post during a stressful situation.</p>   \r\n<p>   \r\nAs we all know, thanks to the film Pink, citizens can file a \'Zero FIR\'. This is a document that can be registered by any police station when a complainant approaches them for a cognizable offence, whether the case is in their jurisdiction or not.</p>   \r\n   \r\n ',	0,	0,	0,	1500,	1,	'2019-12-10 06:58:13',	'2019-12-10 12:41:44'),
(50,	'5dc11fa3e4ab2',	3,	21,	'Make a 5-state Policy to Tackle Air Pollution in NCR',	'Health',	'air-pollution.jpg',	'https://callupon.org/stY',	'<p>It felt like someone had stuffed burning tyres, a hundred unstubbed <strong>cigarettes and the contents of an open drain into </strong>my nose and down my throat. I thought I was going to die.</p>   \r\n<p>   \r\nIt was early November. <span>I remember waking up gagging like the rest of Delhi and parts of the <strong>National Capital Region</strong></span>. The stench was so foul that I could not only smell but taste it.</p>   \r\n<p>   \r\nI made the mistake of stepping out onto my balcony to get some fresh air but instead I inhaled <strong> toxic fumes</strong>. Within seconds the incessant coughing began, my eyes watered and a shooting headache gripped me.</p>   \r\n<p>   \r\nOne didn’t even need to switch on the news to <span>confirm what I instinctively knew: Delhi had turned into a gas chamber - with poisonous gases 70 times the permissible limit! And I was in the heart of it.</span></p>   \r\n<p>   \r\nWhile the better off amongst us followed doctors’ orders to stay indoors, wear masks and buy <span>expensive indoor air purifiers, millions of others suffered a more miserable fate. I’m referring to the underprivileged, the homeless who can’t afford these luxuries, people who need</spam> to be on the move for work and infants, children and the elderly whose immune systems are weaker. #RightToBreathe</p>   \r\n<p>   \r\nMasks and purifiers are jugaad (quick-fixes). They don’t solve the problem. They delay doom. What we need are sustainable, long-term solutions. Our government - the people we elected to protect our well-being are the ones who - should be finding a way out. And fast.</p>   \r\n<p>   \r\nBut instead what we saw playing out in the news was a blame game. One state blaming another. “Stop your farmers from burning rubble”. “No, you people need to curb vehicular pollution.” “Go regulate construction dust first”.</p>   \r\n<p>   \r\nFrankly, I don’t care who did what and why. Neither do the majority of citizens in North India who are suffering this blanket killer smog year after year.</p>   \r\n<p>   \r\nThe time for finger-pointing is now long gone. It’s time for the 5 states most affected by toxic air in North India to work together like the 5 fingers on our hands. They are Delhi, Haryana, Punjab, Rajasthan and Uttar Pradesh.</p>   \r\n<p>This issue should be topmost for the leadership of all NCR states.</p>   \r\n<p>   \r\nBecause toxic air harms everyone. It doesn’t distinguish between the lungs of ministers and common citizens, Punjabi farmers or Delhi car owners.</p>   \r\n<p>   \r\nI’ve started my petition asking the top political parties to  “Create a 5-state policy to tackle air pollution in NCR”  This, in addition to whatever emergency measures need to be taken to tackle the ongoing situation.</p>   \r\n<p>Clean air matters much more to us citizens than votes do to politicians. So I hope the 5 states rise above the petty politics and work in sync.</p>   \r\n<p>   \r\n<span>   \r\nSign and share my petition if you believe you have a right to clean air today.    \r\n</span> \r\n</p>  ',	0,	0,	0,	1000,	2,	'2019-11-05 07:07:15',	'2019-12-10 10:43:19'),
(55,	'5dc16f03f2006',	6,	1,	'Cashless india online',	'10000',	'IMG-20190904-WA0013.jpg',	'https://callupon.org/st3',	'India MART E-COMMERCE PVT LTD   \r\n',	0,	0,	0,	10000,	2,	'2019-11-05 12:45:56',	'2020-02-07 16:38:44'),
(66,	'5def40d4194b4',	2,	33,	'Light up Hyderabad - no woman left afraid',	'No women left afraid',	'lightwomen.jpg',	'http://petition.sheenz.in/be',	'<p>Hyderabad has a problem of dark spots: places that are not properly lit. These dark spots are a menace to the city and our women. Women are subjected to, or are afraid of harassment, eve- teasing, cat calling, stalking, chain-snatching and sexual assault when they have to cross these dark spots.</p> <br />\r\n<p><br />\r\nI cannot put down in words how scared we are to walk on unlit roads. Roads that have poor lighting are hostile towards women and in Hyderabad itself, media has reported that there are 50-60 dark spots with no lighting at all. An enquiry by the previous commissioner of GHMC also showed that there are 20,000 broken street lights in the city.</p> <br />\r\n<p><br />\r\nSign my petition asking the Greater Hyderabad Municipal Corporation to light up 60 dark spots in the city and repair the broken street lights on a priority basis. What are the authorities waiting for? Another crime? Another outrage?</p><br />\r\n<p><br />\r\nSign my petition so that Hyderabad sets an example for other cities when it comes to women’s safety. We owe it to the memory of the young veterinarian. Her death can’t and won’t go in vain. </p><br />\r\n<p><br />\r\nLet us shout for justice and along with it ensure that no other woman feels unsafe! Let’s take real measures to make the city safer for women. It is already too late, let us not delay further. </p>',	0,	0,	0,	1000,	2,	'2019-12-10 06:53:08',	'2020-02-07 16:29:26'),
(56,	'5dc2afc3b3c34',	8,	467,	'Unfair harassment case handling in corporate offices ',	'15000',	'Screenshot_20191106_170156_com.android.chrome.jpg',	'https://callupon.org/st4',	'<p>Women who raise voice against harassment at work place have been more victimised at scrutinised and caused further ill treatment. File petition for their job security and fair laws on these. Managers in India get away inspite of these rules because of retaliation on the complaints.</p> ',	0,	0,	0,	25000,	3,	'2019-11-06 11:34:27',	'2020-02-07 16:44:06'),
(57,	'5dc52c1875763',	3,	1,	'Health is health',	'Health',	'IMG_20191106_173646_879.jpg',	'https://callupon.org/st5',	'<span style=\"font-size:10px;\">B IU</span>',	0,	0,	0,	23,	3,	'2019-11-08 08:49:28',	'2020-02-07 16:43:45'),
(59,	'5de3907415f18',	8,	21,	'A Doctor who Saves Others Life was Herself Helpless',	'A Doctor who Saves Others Life was Herself Helpless',	'nirbhaya-rape-case_1531152272.jpg',	'https://callupon.org/st7',	'<strong>A Doctor who Saves Others Life was Herself Helpless</strong>\r\n\r\n<p>Priyanka Reddy, a Veterinary Doctor faced a brutal sexual assault, murdered and burnt alive. Today the entire social media is asking for her justice: Justice required for Priyanka Reddy</p>\r\n\r\n<p>People are so enthusiast with great aggression asking for justice wherein, everyone demanded that punishment like hanging to death is not enough.</p>\r\n\r\n<p>Obviously, “sentenced to death” is not a sufficient pay-off for these brutal actions. But, what about the daily happenings in the society where there are a lot of rape cases and only a few get highlighted.</p>\r\n\r\n<strong>Woman – an idol or an element of SEX</strong>\r\n\r\n<p>In today’s 21st century, where a woman has all the equivalent rights as that of man, can perform all such stuff which a common man does & is still unsafe.</p>\r\n\r\n<p>Why threatening scenarios still exist in the nation where on Navratri an idol of a woman is worshipped and is raped in common days. Just because of a female’s natural body assets, how come a society can decide and address her standard of living and sense of dressing. Why not males can change their mindset?</p>\r\n\r\n<p><strong>Equivalent Rights in a Male Dominant Society</strong></p>\r\n\r\n<p>Yes, women have indeed got all those rights which a man holds but still, unfortunately, women survive in a male dominating society. India, a country rich in technology and agriculture still lacks much behind when it comes to justice.</p>\r\n\r\n<p>Several cases came into existence which got viral for a week and a month and got closed unexpectedly with no petition and solution. We have heard several cases such as Asifa Rape Case, well renowned 2012 Delhi Gang Rape, Aarushi Talwar’s Murder Case and a lot more. If anyone could have got a proper justice then, no other case would have appeared, unlike today. </p>\r\n\r\n<p>Presently, the situation has become so drastic and worst that even minor children have become a victim of rape. Most of the time, people talk about morals and values but what is happening today comprises no hide and seeks. Whenever any such incident happens, people act and behave too aggressively and sooner with time everyone forgets and moves on. No one withstands and fights for their rights and so does the judgmental bodies. Showcasing different victims in a single case alas!!! unfortunately, the case becomes a mystery with no clarification about the accused and the victim.</p>\r\n\r\n<strong>It\'s not about anyone, it\'s about us</strong>\r\n\r\n<p>We need to be strong enough in all the states specifically mentally, physically and emotionally. Luckily because nothing has happened to us doesn’t mean that we can’t support anyone. Any country is with its citizens or a country and a nation exists because of its residents. Thus, take a stand and be strong enough. This is because, if citizens are aware of their rights and can fight for the same then, no enemy or a rapist can threaten you.</p>\r\n\r\n<p>A female who had become a victim is someone’s daughter, sister, wife, and friend and to all the males, the unforgettable activities that you do with someone’s girl could happen to your girls as well.</p>\r\n\r\n<p>This is what Karma says: what goes, comes around.</p>\r\n\r\n\r\n<p>So, a small message to all…</p>\r\n\r\n<p>Be strong, Be Aware… File a Petition and Fly Like a Flair.</p>\r\n',	0,	0,	0,	20000,	2,	'2019-12-01 10:05:40',	'2019-12-10 10:38:19'),
(72,	'5e32c244b7e82',	2,	28,	'Internet & Internet of Things (IoT) a boon or bane for the Users',	'Internet & Internet of Things ',	'Cybercrime.png',	'http://petition.sheenz.in/bk',	'<strong>Internet & Internet of Things (IoT) a boon or bane for the Users</strong><br />\r\n<b>Indeed, omnipresent is the world of Cyber…</b><br />\r\n<p>How surprising is that our morning begins with internet and ends with the same. Instead, it’s not only the social media that allure us to Facebook, WhatsApp or other social platforms as the new ways of saying Good Morning but there are numerous ways of getting both affected and effected with the same.<br />\r\nTalking about the new age technologies especially the Internet of Things (IoT), it has transformed each small era of everyone’s life. Ranging from toys which have been also turned into digitized way via remote controls, self-driving cars with AI and there are ‘n’ number of things that surrounds us daily. Undoubtedly, every electronic gadget or other associated appliances have computing and could be connected with the internet. This doesn’t get restricted only till desktop and laptop but majorly it’s the mobile devices that act as a major weapon towards cybercrimes.</p><br />\r\n<strong>Cyber Security in Digitized Banking </strong><br />\r\n<p>Even if today, a person’s sentiment might swerve towards avoiding technology but there are some government policies and procedures as well that strive their best in making India a digital as well as the smart country. This not only uses the technology but has also enabled the people with essential and reasonable security too. Owing to the branding, promotion and marketing of cashless India, technology and internet have positively encouraged the people in their everyday life.</p><br />\r\n<strong>Cyber Crime as a Threat via Social Networking </strong> <br />\r\n<p>Alongside the system of digitized banking, the major alarming concern is social networking sites that must be a major trap under cyber laws. Majorly if it is focussed on relationships that have been carried by social networking sites that have threatened people till a huge extent and have also resulted in the drastic and adverse effects. </p><br />\r\n<strong>Crimes are bound with Revenge’s Feeling </strong><br />\r\n<p>Crimes amongst people are bound with a feeling of revenge especially when a couple breaks up. Herein, MMS and porn have become the popular strategy to mentally torture anyone. Due to this, people upload personal pictures and videos majorly nudes or semi nudes and blackmail the concerned person whose content has been uploaded.</p><br />\r\n<strong>Life is taken for granted</strong> <br />\r\n<p>Additionally, most of the cases of morphing faces have also ruined the victim’s life leading to death or another form of losses in life. The doer of the crimes takes it as a granted and feels some delight out of its outcomes but doesn’t even realize the trauma that a victim suffers from. Such crimes do not cost a single penny but result in the major loss of life. However, the only encouraging common ground for such crimes is the mobile and internet connection.<br/><br />\r\nThese crimes do not cost anything with mobile phones and internet connections being commonplace wherein, both child pornography, as well as pornography, closes the circuit of heinous online crimes.<br/><br />\r\nSo, what to do?<br/><br />\r\nWith such the rising rates, of the life losing and threat causing concerns, sitting like a sitter won’t work. The actions taken only by the government by banning such sites or other associated parameters are not enough. One needs to take his or her own stand being stronger at each suffering phase. Though its true and undenied fact that internet has leveraged all our lives to a much higher extent simultaneously, this fact also could not be denied that there are major drawbacks, threats, losses and causes associated with the same.</p><br />\r\n ',	0,	0,	0,	5000,	1,	'2020-01-30 11:47:16',	'2020-01-30 17:17:16'),
(60,	'5de65306a754f',	2,	497,	'Acid Attack',	'Public Awareness',	'Acid-Attack-From-Pain-To-Purpose.jpg',	'https://callupon.org/st8',	'<p>Acid Attack - a Forceful Acceptance or Unwanted Rejection by the Society\r\nVictims of Acid Attack are actually not the victims but the survivors in the society. But,   \r\nunfortunately, the people who do so on the bodies and faces of pretty and beautiful   \r\nladies require to cover their faces. </p>\r\n<p>  \r\nWhat would happen to snatch away the beauty of a beauty?   \r\nHere, the beauty of beauty means the beautiful physical appearance of a female which   \r\nsome societal monsters take away.   </p>\r\n<p>\r\nIndia has seen many cases and faces of acid attacks where the victims reveal both their   \r\ninner beauty and strength to accept the harsh reality of their reshaped physical   \r\nappearance. Alongside government, you need to take action withstanding strong at this   \r\nsocietal threat.  </p>\r\n<p> \r\nCases over Cases Revealing Victims   \r\nMake culture and society so strong that a woman can fearlessly cross a man outside   \r\nher home. There have been many victims such as   \r\nReshma Qureshi, who was just 17 years old, lost her vision. The saddest, harsh and   \r\nunacceptable reality is that her relatives and their friends collectively were involved in   \r\nthrowing acid on her face.   </p>\r\n<p>\r\nLakshmi Aggarwal, who was again a 17 years old girl, became a victim of a brutal acid   \r\nattack by her acquaintances.   </p>\r\n<p>\r\nDifferent Victims, Different Sufferings   \r\nWhereas, both the victims have their sufferings and pains but both of them have   \r\ninspired the society with their belief and strength. The mental trauma of losing your   \r\nnatural physical appearance haunts the most simultaneously the taunts of the society   \r\nand people passing by.  </p>\r\n<p> \r\nYes, not everyone rejects the victim of an acid attack but not everyone accepts them.   \r\nDeep inside the heart people always keep guilt and fear of untouchably and don’t   \r\naccept them.  </p> \r\n<p>\r\nUnanswerable Whys…   \r\nBut, the alarming question here is, why to throw acid on a face? Why haunt a person to   \r\nsuch an extent that without being in any malpractice they have to hide their face and   \r\nhave to ask for dignity? Why to forcefully feel pity for such victims where there are no   \r\n   \r\nflaws? There is ‘n’ number of Why(s) that both the society and governmental bodies   \r\nneed to answer.</p>\r\n<p>   \r\nSympathy or Empathy? Does inner beauty really matter or is just a matter of   \r\nwords?   \r\nMost of the time, people say that inner beauty, good heart, and hard work means   \r\neverything but deep inside, everyone goes beyond physical beauty and appearance.   \r\nThis is just to show the sympathy or a kind of show-off towards the victims of acid   \r\nattack. </p>\r\n<p>  \r\nThe bitter, as well as the harshest reality, is that society is cruel because when people   \r\ntaunt everyone on body shaming focusing on height, weight, health, complexion and   \r\nphysique then, acid attack is a big deal to tackle with.   \r\nSuch victims are not the culprits to be treated helpless in fact, why to make them a   \r\nvictim? When a person who gets targeted for an acid attack without even knowing, is   \r\nalso a human being. They haven’t lost the natural beauty of their own or accidentally.   \r\nThey face a loss of their face or body because of brutal planning by some societal   \r\nmonsters.  </p>\r\n<p> \r\nDignity is ALL Above   \r\nSuch people have equal rights to live in society as they used to live abreast with   \r\ncomplete dignity and respect. Also, instead of hiding your face and feeling ashamed,   \r\nyou should step ahead towards the culprits more strongly with gratitude that you are a   \r\nbeautiful creation of God and nothing can stop you doing all such stuff that you are fond   \r\nof.   \r\nDo not feel sorry instead live more of yourself without the guilt of not having beautiful   \r\nskin or face. Beauty is from the heart and inner beauty reflects from one\'s face and   \r\nthoughts because the face is the mirror of the heart.</p>',	0,	0,	0,	2000,	1,	'2019-12-03 12:20:22',	'2020-02-07 16:22:25'),
(61,	'5de65495dc252',	7,	498,	'LPG',	'Environmental Issue',	'figXdPUQoCtMaVv-800x450-noPad.jpg',	'https://callupon.org/st9',	'<p>LPG Replaced Chulhas Still BPL People are Out of its Reach   \r\nUjjwala Scheme introduced by the government has benefitted people to an extent   \r\nthat simultaneously, it has also left people in the drastic effects. According to the   \r\ngovernment’s data, Ujjwala Scheme targeted 5 Cr. Subsidised LPG connections   \r\nwherein, a major ratio of BPL families has been a dud on the grounds of this   \r\nscheme. It has observed that BPL families have claimed that they are unable to   \r\nafford LPG refills.  </p>\r\n<p>  \r\nScheme Launched: for People Welfare or Votes Bagging?    \r\nHowever, the Ujjwala Scheme was launched for bagging of votes during elections   \r\nwith a promise that each rural woman of below poverty line household would be   \r\nfacilitated with the same but unfortunately, because of the high cost of LPG refills   \r\nthey saw a major dud. The strategy of acquiring the bulk votes was quite interesting   \r\nas it focussed on BPL household visits while sitting on the muddy floor and eating   \r\nthe meal cooked on the earthen stove or Chulhas.  </p>\r\n<p>  \r\nHowever, to get the LPG cylinder under this scheme the BPL family woman required   \r\nto fill a form provided by the respective gas agency while paying the subsidized price   \r\nof ? 1750 otherwise without such scheme it would be costing ? 2950. </p>\r\n   \r\n<strong>A Curse or A Cause</strong>\r\n<p>   \r\nPeople of such families did enjoy the scheme until the time the cylinder doesn’t   \r\nrequire the refill. With the passing away of the gas, they again came back to the   \r\nChulhas using kerosene oil and other kinds of solid fuels. The emitted smoke from   \r\nsuch substances led to hazardous health issues. Moreover, as per the World Health   \r\nOrganisation, worldwide, 3.8 million people die because of the smoke exposure from   \r\nthe dirty stoves. Also, the stats obtained from WHO quoted that in India, 4,88,200   \r\ndeaths occur every year just because of the chronic obstructive pulmonary disease   \r\n(COPD), ischaemic heart disease, due to pneumonia, lung cancer, and stroke. Also,   \r\n8 complete years are lost amid 1,000 people majorly because of the indoor air   \r\npollution wherein, the most affected people are the children and the woman. </p>   \r\n<strong>Saving Wealth or Losing Health</strong> \r\n<p>   \r\nBoth the Indian societies as well as the government need to understand that cooking   \r\non Chulhas renders a huge number of fumes and smog which adversely affect the   \r\nenvironment then, how a human being can remain unaffected from the same? If,   \r\nUjjwala Scheme has been properly implemented focusing on the low cost of the gas   \r\nrefill then, it could have successfully helped the sufferers which they have been   \r\nfacing because of the constant use of Chulhas.   </p>\r\n<p> \r\nThe use of Chulhas adversely affects human health that it can cause a loss of vision,   \r\nlungs problem, inhaling or other breathing problems and a lot more than one can   \r\never imagine. For your safeguard, you need to take any action while not fully relying   \r\non government schemes. However, the government must support people with the   \r\nproper implementation of such schemes. It must organize the schemes that it may   \r\nnot affect the people for a shorter time span, in fact, help them in solving all their   \r\ndaily hurdles.  </p>  \r\n<strong>One Initiative is Essential</strong>\r\n<p>   \r\nThe people of such areas are out of the reach of a flourished money, so they feel   \r\nthemselves helpless. At least, one can be a light of help for them so that with one’s   \r\n   \r\ninitiative the entire society can be saved. Also, as per the government concerns, it   \r\nshould have set up the reasonable prices of gas refilling that people from Chulhas   \r\nmay move towards the LPG. This would surely bring a positive effect on society and   \r\nthe economy.  </p>\r\n<p>  \r\nAgain, the concluded reason states that the unaffordability of LPG cylinders is the   \r\ncore concern of using Chulhas with the help of cow dung and coal that are easily   \r\naccessible. Else, in the fastest running era of the technology where Gas Stove is   \r\nbeing also replaced by the Electronic Induction, who wants to cook food on the   \r\nburning wood emitting fumes. The Government needs to reduce the prices of gas   \r\nrefilling that no house may remain left with the LPG cylinders.    \r\nPeople must also know the worth and importance of their health and time which is   \r\nbeing wasted sitting in front of Chulhas.</p>',	0,	0,	0,	2000,	1,	'2019-12-03 12:27:01',	'2020-02-07 16:35:35'),
(62,	'5de7820f8d025',	2,	499,	'Acid Attack',	'Public Awareness',	'Acid-Attack-From-Pain-To-Purpose.jpg',	'https://callupon.org/stba',	'<p>Acid Attack - a Forceful Acceptance or Unwanted Rejection by the Society\r\nVictims of Acid Attack are actually not the victims but the survivors in the society. But,   \r\nunfortunately, the people who do so on the bodies and faces of pretty and beautiful   \r\nladies require to cover their faces. </p>\r\n<p>  \r\nWhat would happen to snatch away the beauty of a beauty?   \r\nHere, the beauty of beauty means the beautiful physical appearance of a female which   \r\nsome societal monsters take away.   </p>\r\n<p>\r\nIndia has seen many cases and faces of acid attacks where the victims reveal both their   \r\ninner beauty and strength to accept the harsh reality of their reshaped physical   \r\nappearance. Alongside government, you need to take action withstanding strong at this   \r\nsocietal threat.  </p>\r\n<p> \r\nCases over Cases Revealing Victims   \r\nMake culture and society so strong that a woman can fearlessly cross a man outside   \r\nher home. There have been many victims such as   \r\nReshma Qureshi, who was just 17 years old, lost her vision. The saddest, harsh and   \r\nunacceptable reality is that her relatives and their friends collectively were involved in   \r\nthrowing acid on her face.   </p>\r\n<p>\r\nLakshmi Aggarwal, who was again a 17 years old girl, became a victim of a brutal acid   \r\nattack by her acquaintances.   </p>\r\n<p>\r\nDifferent Victims, Different Sufferings   \r\nWhereas, both the victims have their sufferings and pains but both of them have   \r\ninspired the society with their belief and strength. The mental trauma of losing your   \r\nnatural physical appearance haunts the most simultaneously the taunts of the society   \r\nand people passing by.  </p>\r\n<p> \r\nYes, not everyone rejects the victim of an acid attack but not everyone accepts them.   \r\nDeep inside the heart people always