e guilt of not having beautiful   \r\nskin or face. Beauty is from the heart and inner beauty reflects from one\'s face and   \r\nthoughts because the face is the mirror of the heart.</p>',	0,	0,	0,	2000,	1,	'2019-12-04 09:53:19',	'2020-02-07 16:35:19'),
(63,	'5de9e7fe751b5',	6,	500,	'Onion Rates Spike',	'Price inflation',	'1235662_Wallpaper2.jpg',	'https://callupon.org/stbb',	'<p><strong>Onion’s Chopping Makes Eye Teary but Rising Rates of Onion have Seriously Made Citizens Cry </strong></p>\r\n<p>\r\nIndian people are left with the teary eyes because of the rising prices of the onion wherein, the prices have touched ?120-150 per kilo. Moreover, the prices are expected to soar more by the end of February 2020.</p>\r\n\r\n<p><strong>Triggering of Unseasonable Rainfall led Crop Damage  </strong></p>\r\n\r\n<p>The prices of onion have risen drastically in all over the country. The reason behind the rising cost is unseasonal rain as well as the shortage of onion crop. Also, the worst part is that the rising cost has not even benefited a single farmer instead they have complained that none of the onion crops has been fetched because of its poor quality. </p>\r\n\r\n<p><strong>Increasing Consumption led to Decreasing Requirements </strong></p>\r\n\r\n<p>In accordance with some sophisticated sources, in India, the monthly consumption of onions was 15 lakh metric tons which shows a requirement of 50 thousand metric tons. But, with the high cost, the daily supply has become 10-12%, as of now. </p>\r\n\r\n<p><strong>Appeal to Government – a Solution for a Common Man</strong></p>\r\n\r\n<p>Most of the people and other associated welfare bodies have asked the government to create onion’s buffer stock, distribution of the staple at a reasonable cost, a crackdown on the hoarding of onion’s traders, etc just to relief a middle class and a common man. Onion as a staple of each kitchen in every household has affected not only the general public but a huge mass of farmers as well. Indian farmers have emotionally expressed a painful concern because most of them are distributing the old stock of onion because of the damaging of new onions. </p>\r\n\r\n<p>Just because the wholesale market has seen a huge spike in the cost, it has simultaneously affected the resulting market as well. Wherein, this sharper jump is restricting the public to make a hole in their pockets. </p>\r\n\r\n<p>The nationwide surge in the spike of onion price has affected most of the Indian states and cities such as Pune, Maharashtra, Chennai, Mumbai, Odisha, West Bengal, Kolkata, Delhi and a lot more. Therein, it has affected the market chain by affecting both the sellers and consumers in buying an onion. Nevertheless, daily consumers are unfortunately are forced to reduce their purchases and are cooking their delicious food as – onion free. </p>\r\n\r\n<p><strong>Battlefield between State & Central Government </strong></p>\r\n\r\n<p>On the other hand, the worst condition expressed by the farmers is the rotten onion which can neither be used nor purchased and can only get wasted by throwing and dumping it in the dustbins. Most of the citizens have appealed to the Central Government to take impactful immediate actions but, the tussle amid the state and the central government is affecting the common man, alas!!! </p>\r\n\r\n<p><strong>Onion’s Robbery at Dusk’s Early Hours </strong></p>\r\n\r\n<p>Also, the robbery of goods that can benefit you in any ground has been seen and observed in several different cases. But, have you ever heard of Onion’s robbery. Could you ever imagine that onions can also be getting stolen? Sounds funny; but, it’s true, 250kg onions worth ?2500 have been stolen from Gujarat vegetable shop during the early hours of dawn.</p>\r\n\r\n<p><strong>The Government in Jitters & Public in Tears </strong></p>\r\n\r\n<p>Such a looming onion crisis has put the government in jitters as well as the general public in tears. Therein, huge strata focussing on several households, cafes, and restaurants have been affected adversely. In short, this food inflation has made the entire nation cry where people are left with no choice just to maintain a cost-cutting for onion. </p>\r\n\r\n<p>The Indian Government must enlighten the issue and should immediately take the concern into consideration. This is because the continuous spike in the price is neither good for the country and nor for the Indian traders and farmers who are stagnantly witnessing a great fall in the onion demand.  </p>\r\n\r\n<p>Onion, with which every food tastes tasteless, is now getting reduced from the daily menus, dishes, and salads. However, to avoid the further disruption of the onion trade in the country, the government has placed orders for 6,090 tonnes of onions from Egypt to prevent India from Onion’s Crisis. This initiative would somewhere support the daily income of Indian farmers. </p>\r\n\r\n<p>Hope so, fresh and quality harvest may sooner hit the Indian market vanishing food inflation at its best.</p>\r\n',	0,	0,	0,	2000,	2,	'2019-12-06 05:32:46',	'2019-12-10 10:15:27'),
(73,	'5e32c5969d147',	2,	28,	'Increasing Robbery, Growing Theft Should Result Accused in a Major Suspect',	'Increasing Robbery, Growing Theft Should Result Accused in a Major Suspect on social media',	'robbery.jpg',	'http://petition.sheenz.in/bl',	'<strong>Increasing Robbery, Growing Theft Should Result Accused in a Major Suspect </strong> <br />\r\n<p>Since the past few years in India, Robbery and other associated criminal rates are increasing at a massive pace. Ranging from chain snatching to mobile, cash, electronic gadgets and a lot more gets robbed or snatched away by various unexpected and surprising threatening tricks in just a blink of an eye. Herein, the practice of hypnotism is also encouraging robbers to take away the people’s belongings by their own will and wish. </p><br />\r\n<strong>Cases over Case, Reports are noted but gets Unnoticed </strong><br />\r\n<p>Over the past few years, Indians are being in a tap of such crime that people are not safe in their own house ranging from dusk and dawn. This is so because; there is no fixed time of robbers to attack and to rob. Therein, many shocking cases are being increasingly growing majorly in India. Every year, there have been a dozen reports that get noted in the police station for investigation and verification but unfortunately, nothing gets into consideration. Owing to such unethical practices of both the police and robbers, robberies of varied different belongings have become a business amongst illiterate and uneducated youth. </p><br />\r\n<strong>Robbery begins from one\'s own self </strong><br />\r\n<p>Moreover, youngsters are heavy in number, majorly of the teenage and the people up to an age of 25 years old. It’s completely an obvious fact that such people are more prone to drug addiction, drinking, smoking, adultery etc. and once they get addicted or attracted towards it, their only source of buying their stuff becomes either robbery or stealing. The unacceptable but the real fact is that it begins from one\'s own house itself such as taking away money from parents wallet without even informing them. This stealing of smaller amount later leads to the major robberies outside from their home. </p><br />\r\n<p>Such unethical, as well as illegal practices, have now become unsafe for the people to normally walk on the streets and roads majorly in the context of females. On the isolated streets, bikers come in a pair with the very fast speed and snatch away the gold or other materialistic belongings, mobile phones, cash, wallets etc whilst showing a gun or knife. The worst part of their trick is that sometimes they show the artificial or toy gun which seems like an original sample just to threat the people hovering around. Additionally, such incidents sound to happen in the deserted streets but unfortunately, it happens in the crowded areas where just because of the threatening practices people become helpless to help each other and other records the videos of the incident.</p> <br />\r\n<p>Several times, any such sudden and threatening incidents leave the victim in a brutal state of mind, scared and injured that draws the attention of the general public present at the incident’s spot wherein, any one of them who feels essential to inform police, inform them, rest other just remain same in their happening activities. </p><br />\r\n<p>Also, these robbers are so cunning and smart that while performing robbery or snatching something, they change their clothes that increase their chances of not being caught. Most often these robbers either carry a pair of extra jacket or shirt with them and always apply some lubricated substances on their body so that, if they get cached by someone they could easily slip and can run away. After acquiring the stolen goods, these robbers sell the desired products and earn their desirable profits.</p> <br />\r\n<p>Their smooth escaping practice makes them difficult to trace whereas, surveillance of CCTV sometimes could help to an extent. Owing to this, police have now become familiar with their unethical practices but unfortunately, do nothing until and unless they seem their own profit in helping the victim by any means or by a bribe.</p> <br />\r\n<strong>If such remains continue to happen then, where would our nation go? </strong><br />\r\n<p>Thus, people are requested especially the females to carry the essential precautionary measures with them such as a pepper spray, a pointed pen, knife or anything that could be beneficial in self-defense. </p><br />\r\n<strong>Eat, Repeat and Sleep – Robbery </strong><br />\r\n<p>Moreover, if an accused get caught and punished, their punishment gets restricted till imprisonment of some time. After getting released, they do the same practices again just to eat, repeat and sleep which happens in the jail as well. So, such people don’t get affected while getting caught. </p><br />\r\n<p>Thus, this won’t work in building a better as well as the developed nation instead; both the purpose and practice of crime highly need to be figured out. If this could be done, the prisoners must be rehabilitated prior to getting bailed or released. Also, they should be gone to some psychiatric therapy sessions so that no individual gets threatened again and feel unsafe on hovering on the isolated streets. <br/><br />\r\nHence, by identifying the root cause of the problem and solving it accordingly could work better with time, somehow and someday. </p><br />\r\n<br />\r\n ',	0,	0,	0,	5000,	1,	'2020-01-30 12:01:26',	'2020-02-07 16:35:50'),
(64,	'5deb54cd11bd7',	4,	501,	'Unemployment – A Constant Fear or Threat of Losing Job ',	'Social Reach',	'unemployment.jpeg',	'https://callupon.org/stbc',	'<strong>Unemployment – A Constant Fear or Threat of Losing Job </strong>\r\n\r\n<p>\r\nPeople learn to earn and run their livelihood where learning doesn’t require any age or stage. Also, the process of learning begins with birth. Well, coming to the major use of learning in the Employment sector, it gets stopped at a certain level or gets restricted because of cost-cutting.\r\nSince, the downfalls in the GDP and other aspects of the Indian Economy, most of the employees have suffered and are still suffering the firing policies. Herein, the targeted employees are either the over-qualified people as per the company’s standards or the employees that are high salaried.</p>\r\n<p>\r\nMost of the organizations plan layoffs majorly for cost-cutting or due to the stagnant business strategies. Specifically talking about the private sector, employees always carry a mental trauma and fear or risk of losing their jobs because companies these days try to lay off approx. 5-8% of their entire workforce. </p>\r\n<strong>Why the Brain Drain? </strong>  \r\n<p> \r\nThis worst situation will also drown the country if the skill and talented mindsets would not be paid as per their qualifications, knowledge, and experience. This is also one of the major reasons for Brain Drain wherein, country and employment sectors should not have any authority to oppose and interfere. Just because, people both experienced and fresher do not get their demanded or wanted salary and become a victim of hire and fire hierarchy, seek for better opportunities in foreign countries. <p>   \r\n\r\n<p>    \r\nThey acquire and gain the knowledge fulfilling the criteria for any job role from India and work for other countries where their talent gets respect and they are paid as per their skills and knowledge. Here, the nation lacks much behind in terms of growth and development majorly focusing on employment. </P>   \r\n<p>   \r\nAlso, the ones who even doesn’t afford the good qualification and thus, do not get the jobs, work as vendors, auto-rickshaw or taxi drivers, work in café, tea stalls or restaurants and in fact, there is ‘n’ number of small scale professions. </p>   \r\n    \r\n<strong>Unemployment exists because of Cost-Cutting Strategies </strong>   \r\n<p>\r\nStreamlining cost has given birth to unemployment at a broader scale. On the other hand, coming to the government jobs, the competition is again too tough and stiff that a single vacancy for any of the designation requires the processing of 6-8 months. Most of the people from the age of 18 and above apply for the government vacancy with a hope that one day they may get a chance of having complete job security. Contradicting to this, again for a smaller number of vacancies, a huge number of people apply nationwide wherein, a few get a chance of selection.  <p>  \r\n    \r\n<strong>Employing the Unemployed has become an Occupation</strong>   \r\n<p>\r\nAlso, employing unemployed people has become a business. Most of the people play fraudulent activities with the name of branded organization and promise to unemployed ones providing a job with complete security. When a jobseeker gets influenced by the fraudsters, they ask for money. If a person gives the quoted amount then, these fraudsters run away leaving behind a no clue of their identification. </p>\r\n<p>    \r\nNo one knows where a nation will go if this would be continuing the way it is. Also, in the era of technology as well as digitalization, Information Technology (IT) domain is phasing the rough period of streamlining cost majorly concentrating on the employees of mid to senior level. Undoubtedly, this would further take the nation on the highest toll of unemployment in the next coming quarters. Owing to this, people tend and prefer to work in the UK, the US and other developed countries letting go of the Indian IT Sector and varied other sophisticated domains. </p>   \r\n    \r\n ',	0,	0,	0,	5000,	2,	'2019-12-07 07:29:17',	'2020-02-07 16:37:54'),
(65,	'5deb58e1e223c',	2,	502,	'Priyanka Reddy’s Soul RIP whilst Accused Shot Dead by Hyderabad Police',	'The communalisation of rape by right-wing handles and outlet on social media',	'image.jpg',	'https://callupon.org/stbd',	'<p>On December 6, 2019, Hyderabad Police dead shot all 4 accused rapists and murders who took away the life of 26 years old Priyanka Reddy. The cops arrested all 4 named as Mohammad Ali alias Mohammad Arif, Jollu Shiva, Jollu Naveen Kumar, and Chintakunta Chenna Keshavulu. </p>\r\n\r\n<p>Finally today, the victim of brutal rape and murder got real and complete justice.  <strong>According to Police, all 4 accused have been killed in crossfire on Friday especially in the wee hours at the same highway where the burnt body of Priyanka was found. The accused were taken to the same spot and recreated the crime scene. All 4 tried to run and the moment they tried to flee, the IPS Office V.C Sajjanar IPS (Vishwanath Sajjanar) shot them. </strong></p>\r\n\r\n<p>As per the Hyderabad Police, the entire incident took place at 6:30 am. The purpose of encountering the accused in this way was the part of the investigation. Also, the accused forcefully snatched the guns from the police and fired on them and tried to escape from the site immediately. For safeguard and justice purposes, the police fired and shot them in which all 4 accused died. Also, as per the investigation from Hyderabad Police, the accused intentionally punctured the tire of Priyanka’s two-wheeler, offered her help, took her to hidden spot and brutally raped her. All the 4 accused were lorry workers and aged amid 20-25 age group. </p>\r\n\r\n<p><strong>Court’s Justice or Police’s Action</strong></p>\r\n\r\n<p>This time not waiting for the court’s justice, Hyderabad Police took initiate on their own and supported the nation in the justice of Priyanka’s family. Till date, there is no hidden fact, that the accused of Delhi Gang Rape 2012 are still in jail and no punishment has been announced for them. The duration of 7 years is not short. If at that time, the court has taken a fair and immediate action and justice, no Priyanka could become the victim of a brutal rape and murder case again. </p>\r\n\r\n<p><strong>Hiring a Lawyer or helping them in running their livelihood</strong></p>\r\n\r\n<p>People seek justice from the court but the Indian Judicial system just delays the cases giving dates over dates. A common man or a middle-class family affords a lawyer and a judge for the fair justice but, this has become a business to earn a livelihood now. Judicial bodies and systems do not understand the pain points of a common man instead of considering their money as their fees on the longer-term aspects which help them to earn and run their livelihood. </p>\r\n\r\n<p><strong>Rapist Shot, Citizens Shocked</strong></p>\r\n\r\n<p>This time, Hyderabad Police took action wherein, it was unbelievable for the citizens of the nation and simultaneously for the family members of a victim’s family. Was it Priyanka’s destiny or just was a furnished plan of the cops to give an answer to the nation for justice.? </p>\r\n<p>This time, immediate action has been taken while not hoping much from the judicial system. The nation is in the hope that no rape case may take place and no girl crossing on the road becomes a victim. This might also act as a lesson for the judicial system and other police officers as well that citizens seek their help for fair justice and not for the dates over dates on the grounds of court. </p>\r\n',	0,	0,	0,	2000,	2,	'2019-12-07 07:46:41',	'2019-12-10 12:01:35'),
(74,	'5e393ec904ba9',	2,	28,	'Censor Free Content on the Internet is proven to be Engaging or Diverging Audience',	'Censor Free Content on the Internet is proven to be Engaging or Diverging Audience spread on social media',	'China-network.jpg',	'http://petition.sheenz.in/bm',	'<strong>Censor Free Content on the Internet is proven to be Engaging or Diverging Audience </strong><br />\r\n<p>In the present scenario, today is the time of technology and advancements in almost all varied entertaining modes and industries. Time has flown when people were supposed to sit in front of a TV on Sundays and were fully dependent on DDs Channel. This 21st century fledges with technical advancements affecting all the aspects of human life. So, if we speak about the (digital TV), probably, you can explore the world and its associated spice within a fraction of seconds.</p><br />\r\n<strong>Censor-Free Content - a fun BELOVED & LOVED by all </strong><br />\r\n<p>No doubt, it is correct saying that all of us require some spice and fun for entertainment where definitely, the path of entertainment and fun may seem variable. This is so because constancy always creates boredom to an extent. Several times, a person prefers different sorts of fun activities wherein, social media and availability of censor-free content on the Internet are preferred the most. Talking about the easy availability of censor-free content, these days, films are being released at no cost on different internet platforms such as Netflix, Alt Balaji, Zee 5 and there are ‘n’ number of such platforms. </p><br />\r\n<p>It has proven both as the boon and bane for the Indian society affecting the socio-cultural implications of the same as well. In today’s era of digitization where theatres and televisions are also turning to be digital, the early aspect for searching the content begins with such online platforms. It has not only influenced the social-cultural ethics of human life instead has also equally impacted life economic life of the people affecting their lifestyle, standard of living, ways of making expenses, gender, language, ethnicity and much more. </p><br />\r\n<strong>A biggest Hit to Online Platforms </strong><br />\r\n<p>Unfortunately or undoubtedly, such availability of censor-free content on internet platform has become a structure of dominance in cultural values affecting morals and encouraging adultery and crimes amid the people. On the other hand, the reflection of such content has also led the society towards innovation and smartness to cope up with the daily happenings and incidents of the society that has also proven to leave the society with the huge impacts. </p><br />\r\n<p>Today’s teenage and younger generation watches a broader spectrum of the romantic, lusty, controversial plots that encourage them to try it practically in their real-life. Such aspects majorly focus on homosexuality, transgender, child labor, poverty, unemployment, prostitution and a lot more till a huge extent. Such topics have brought a world together and united but have also departed people with each other. Where relationships were priorities, people especially vacant their time to meet and see each other has now been replaced by the online platform availing easy accessibility of censor-free content.</p><br />\r\n<strong>Everyone knows NOSTALGIA!!! </strong><br />\r\n<p>However, like a coin have two faces: the heads and the tails similarly, the presence of censor-free content has two factors; the advantages and the drawbacks. Neither all the content provokes people to commit any crime nor encourages the adultery amongst them meanwhile at the same time, it insists or attracts people towards the same and makes them an addict.</p><br />\r\n<p>Nowadays, the recent ongoing trends in the theatres & Bollywood are the daily introduction of new faces in the industry and releases of new movies on frequent time intervals. The same happens with the free availability of content on the Internet. </p><br />\r\n<strong>Contradiction...</strong><br />\r\n<p>It is not said that the movie is the only best option to entertain ones or yourself. Instead, there are varied other forms of the options as well as superior modes of entertainment via which you can laugh, enjoy, entertain and pamper yourself. It seems a little contradictory, but the fact is that... real entertainment is the only one via which you get self-satisfaction and pleasure. It can be anything, any activity etc.<br/><br />\r\nThe concept of censor-free content is deeper in itself which also constitutes major importance. An absence of the same would lead your life towards boredom and dullness. </p><br />\r\n<br />\r\n ',	0,	0,	0,	6500,	2,	'2020-02-04 09:52:09',	'2020-02-07 16:30:38'),
(75,	'5e3a5c4661b5d',	2,	28,	'Corona Virus: An Epidemic, Spreading Globally Tapping People at Large Scale',	'Corona Virus: An Epidemic, Spreading Globally Tapping People at Large Scale',	'Coronavirus.jpg',	'http://petition.sheenz.in/bn',	'<strong>Corona Virus: An Epidemic, Spreading Globally Tapping People at Large Scale </strong><br />\r\n<p>When a person deals with an epidemic, he barely holds hope. This is actually so because the word epidemic itself comprises of a huge meaning in its existence. An epidemic could be anything which begins with a small symptom and later turns into a big disease and hence is termed as Epidemic.</p> <br />\r\n<p>These days, the same is happening in the case of Coronavirus. However, people are getting various information and facts regarding the virus and hence, is listed as the infodemic.<br/> <br />\r\nAs the Coronovirus is rapidly increasing in the major countries of the world wherein, China has been hugely tapped by it. The virus has been s threatening and has proven to be life taking amid the people that everyone fears with its name. The major issue is the recognition of the same i.e. how to analyse and diagnose that whether a person is suffering from some illness is either Coronavirus or something else. So, the symptoms and diagnosis of the virus are mentioned below: <br/><br />\r\n· Fever <br/><br />\r\n· Cough <br/><br />\r\n· Shortness of breath  <br/><br />\r\n· Runny Nose <br/><br />\r\n· Headache  <br/><br />\r\n· Sore Throat <br/><br />\r\nThough such symptoms are found to be very common and can be easily cured but in case of such virus, these symptoms should not be overlooked as it has caused a large number of deaths these days in just the couple of days. Thus, for confirmed, 2019-nCoV infections have reported a severe illness leading death. </p><br />\r\n<p>It is also believed that the symptoms of 2019-nCoV may appear either in 2 days or as long as in 14 days. Also, it is entirely based on the incubation period of the MERS virus. Apart from such noticeable symptoms, it also includes some other symptoms as well such as 229E, NL63, OC43, and HKU1. All such symptoms generally caused some upper-respiratory tract illnesses majorly in the context of common cold, pneumonia or bronchitis. However, such illness is basically found in the people suffering from cardiopulmonary disease and the people with the weaker immune system. </p><br />\r\n<p> In addition to this, one should also enlighten that the other two associated symptoms of Coronavirus i.e. MERS-CoV and SARS-CoV have also become frequently familiar with the people resulting in life-ending happenings. With the sufferings of such virus, approx. 3-4 people out of 10 have been sentenced to death on almost frequent hourly intervals. </p><br />\r\n<strong>What precautions one should take for avoidance and prevention of Coronavirus? </strong><br />\r\n•    Frequent hand washing with alcohol-based hand wash or liquid soap as it would help in killing the germs and virus. <br/><br />\r\n•    Maintain respiratory hygiene. This would be only performed while covering both face and mouth with tissue paper or handkerchief mainly while coughing and sneezing. Doing so would help in preventing the germs and virus and could contaminate the objects or people you come into contact with. <br/><br />\r\n•    Stop touching your mouth, face, nose and eyes because touching such surfaces could result in virus contamination. Touching such parts may result in virus transferring immensely and exceptionally. <br/><br />\r\n•    Avoid consuming animal’s products (all forms of non-veg) and stop being into contact with the animals like camel, rats, cats, rodents, birds, bats and dogs as well. <br/><br />\r\n<p>Therefore, the diagnosis of such symptoms has been essentially required to save people from the massively growing epidemic all around the clock. Your doctors and other health care providers should examine you by performing some of the laboratory tests on respiratory specimens all the major blood test (called serum) in order to detect the presence of Coronavirus if any. If you found the test with positive results, then, you must immediately contact your doctor informing him about your recent travelling, non-veg intake and animal’s contact. A large number of MERS-CoV infections has been detected from Arabian Peninsula’s country and so, it becomes highly essential to note and report about your travel diaries and history or animal’s contact. Herein, animal contact fundamentally means with contact with camel or camel diaries and products.</p> <br />\r\n<p>Thus, if you are suffering from fever, cough and cold then, you should immediately pay <br />\r\nattention to the same before it becomes serious or life-taking. </p><br />\r\n ',	0,	0,	0,	10000,	2,	'2020-02-05 06:10:14',	'2020-02-07 16:31:29');
