(2,	'5da406391a677',	7,	2,	'Children demand Declaration of a National Climate Emergency and Tackling of Climate Change',	'text',	'Pad2.jpg',	'https://callupon.org/stc',	'<div> <em><strong>Record-breaking heat waves</strong> have become a regular occurrence in India, killing thousands of people. Melting snow-caps are slowly increasing the sea level.</em> </div><br />\r\n<div><em><strong>Rainfall patterns in India are changing</strong>, and this has had a devastating effect on farmers’ harvests and affecting </em><em>the migration patterns of different birds and animals.</em></div><br />\r\n<div> <em><strong>The hottest days of the year will grip much of central and northern India</strong> in the coming days, and this heat wave is unlikely to end anytime soon.</em> </div><br />\r\n<div> <em><strong>Dust-storms and increased levels of air pollution</strong> - these seem to have become the normal way of living for most of us.</em> </div><br />\r\n<div> I am a class 11 school student, and being a nature enthusiast, I know what <strong>repercussions</strong><strong> several years of ignorance towards global warming</strong> will have for India in the long run. </div><br />\r\n<div> The human race has already caused irreversible climate change, the impacts of which are being felt around the world. <strong>But it’s not too late.</strong> </div>',	0,	2,	0,	3000,	2,	'2019-10-14 05:23:05',	'2019-10-23 13:27:34'),
(5,	'5da40852c4d02',	5,	2,	'Stop Renting Forts in Maharashtra',	'text',	'pad5.jpg',	'https://callupon.org/stf',	'<div> The Forts in Maharashtra depict the valour of great leaders like Chhatrapati Shivaji Maharaj and our glorious history. However the Government of Maharashtra has decided to convert these forts Heritage Hotels and Wedding Venue. </div><br />\r\n<div> Strongly oppose Maharashtra Governments decision of converting Forts into Heritage hotels and wedding venues. The forts in our state need to be preserved and made history museums of global standards. </div><br />\r\n<div> I urge every one of you to sign this petition asking the Government of Maharashtra to withdraw this decision. </div><br />\r\n ',	0,	0,	0,	3000,	2,	'2019-10-14 05:32:02',	'2019-10-18 16:15:38'),
