(19,	'5dae97bd39830',	2,	9,	'Commit to Clearing Up Ghazipur Landfill #CleanTheMess',	'Text',	'TDRYYLbcAjrTDnv-800x450-noPad[1].jpg',	'https://callupon.org/t',	'<p>Every Indian dreams of a house with a view of the mountains. But the view we have every single day is nothing less than a nightmare. We live in a skyscraper overlooking <strong>the Mount Everest of garbage dumps: Ghazipur, a massive landfill</strong> where all of Delhi’s garbage gets dumped. One news article we read says the landfill is spread <strong>as wide as</strong> <strong>29 football fields</strong> and is nearly <strong>as high as the Qutab Minar</strong>.</p>\r\n\r\n<p>While the Qutab Minar is a breathtaking monument, the <strong>towers of trash </strong>at Ghazipur are making residents in surrounding areas like us gag and hold our breath.</p>\r\n\r\n<p>The stench of rotting waste is <strong>releasing poisonous gases making everyone sick</strong>. We can’t even open our windows without vomiting. The toxic air has ruined our air purifiers and caused pipe leakages. Think of what it is doing to our bodies. It’s been <strong>17 years</strong> <strong>since Ghazipur ran out of space and should have been shut down but the trucks continue to dump waste there</strong>. Two years ago, a part of this <strong>landfill collapsed</strong>, <strong>killing 2 people</strong>. And still <strong>no action.</strong></p>\r\n\r\n<p>How can a mountain of garbage of such great proportions be <strong>invisible to our civic authorities</strong>. Save us from this <strong>ticking time bomb.</strong></p>\r\n\r\n<p>We have started this petition because we are sick of falling sick. We are sick of the inaction by authorities. <strong>We had given up all hope until we read about an IAS officer in Indore who was covered by the media for clearing up a similar but much smaller landfill under his jurisdiction in 6 months!</strong></p>\r\n\r\n<p>It gave us an idea of starting this campaign. We’re <strong>asking municipal authorities  to bring in IAS officer Asheesh Singh to hold technical consulting workshops for Municipal Corporation workers in Delhi to initiate the process of transforming Ghazipur landfill into a clean, green patch of land.</strong></p>\r\n\r\n<p>Help us <strong>green this landfill</strong> which is not only a health hazard for us citizens, but a blot on the<strong> global image </strong>of our national capital Delhi and on our collective vision of <strong>Swachh Bharat.</strong></p>\r\n',	0,	0,	0,	50000,	1,	'2019-10-22 05:46:37',	'2019-10-23 17:41:23'),
(20,	'5db0058a8c88e',	2,	1,	'NBCC submits revised plan to complete Jaypee projects',	'Plan',	'cons.jpg',	'https://callupon.org/u',	'<div><br />\r\n<p>The National Buildings Construction Corporation (NBCC) on October 17 submitted a revised proposal to complete the stalled projects of Jaypee Infratech. The proposal was later handed back to the NBCC counsel</p>.<br />\r\n<p>The homebuyers\' counsel urged the top court to share a copy of the NBCC proposal with them.</p><br />\r\n<p><br />\r\nMeanwhile, the Jaypee Group has moved the Supreme Court against the National Company Law Appellate Tribunal (NCLAT) order that barred its parent company Jaypee Associates from bidding for Jaypee Infratech (JIL). The realtor urged the SC hear its plea seeking to consider its own proposal on the project.</p><br />\r\n<p><br />\r\nThe top court said it will hear the Jaypee Group plea on October 22, and extended the status quo on its insolvency proceedings till then.</p><br />\r\n<p><br />\r\nOn August 2, the Supreme Court had ordered a two-week status quo on Jaypee Group\'s plea against the NCLAT order after it was informed that Parliament had passed the proposed amendments to the Insolvency and Bankruptcy Code (IBC).</p><br />\r\n<p><br />\r\nOn July 30, the NCLAT had extended JIL\'s resolution process by 90 days, thereby allowing submission of fresh bids for the bankrupt realty company.</p><br />\r\n<p><br />\r\nThe Tribunal said the process of bidding and approval of a resolution plan by the Committee of Creditors (CoC) should conclude in 45 days.</p><br />\r\n<p><br />\r\nThe 90-day extension comes amid the lenders\' request to exclude around 250 days, from September 17, 2018 to June 4, 2019, from the stipulated period for the insolvency resolution process, as during this period no bid could be voted upon in view of the confusion regarding homebuyers\' voting rights.</p><br />\r\n</div>',	0,	0,	0,	1900,	1,	'2019-10-23 07:47:22',	'2019-10-23 17:41:27'),
(21,	'5db006a87a0c5',	5,	1,	'Chennai: Bucking economic slowdown, developer to take 350 to employee',	'text',	'itparkcity.jpg',	'https://callupon.org/v',	'<div><p><br />\r\nA red London double-decker bus passes the London Eye on Westminster Bridge .<br />\r\n</p></div><br />\r\n<div><p><br />\r\nCHENNAI: Not all real estate developers are cribbing about the sluggish market. A Chennai-based developer, Casagrand, which has been able to clock sales of Rs 1,800 crore per annum even during the current slump, is sending 350 of its top performing employees to the UK on a five-day company-sponsored holiday trip.<br />\r\n</p></div><br />\r\n<div><p><br />\r\nArun Kumar, MD of the company, has been personally organising junkets for his top-performing employees since 2013. “I have taken them to Singapore, Thailand, Sri Lanka, Dubai and Malaysia. In between, we skipped one year as we missed the sales target. People above the assistant manager-level and those who have completed three years of service are eligible for this paid holiday,” said Kumar.</p></div><br />\r\n<p><div><br />\r\nThe company had proposed to take about 500 employees this year for achieving sales of Rs 1,800crore and collection of Rs 1,800crore in the last financial year, but many failed to get visa on account of eligibility issues, he said.<br />\r\nGowtham Aggarwal, senior VP of Casagrand, said a company-sponsored holiday gives opportunity to scores of people who would not have even dreamt of flying abroad. “Not all can afford a personal holiday. When the company takes them abroad on holiday, it motivates them to perform better in future. As they get recognised by the company, they gain a lot of respect from their family members. In turn, their respect for the company also goes up,” said Aggarwal.</p></div><br />\r\n<div><p><br />\r\nIn terms of rewarding loyal and high-performing employees, none can perhaps beat Surat-based diamond merchant Savji Dholakia, who gifted Mercedes Benz SUVs worth Rs 1crore each to three of his employees last year for completing 25 years of service in his Hari Krishna Exports, which clocks more than Rs 6,000crore turnover per annum. Dholakia had gifted 500 flats and 525 pieces of diamond jewellery to his employees during 2014 Diwali as bonus. Two years later, he gifted 1,260 cars and 400 apartments to top performing employees.<br />\r\n</p></div><br />\r\n<div></p><br />\r\nCasagrand’s sops to its employees have been announced on a day international real estate consultant Knight Frank, FICCI and National Real Estate Development Council brought out a report saying the sentiments of home buyers plummeted to demonetisation level in the July-September quarter despite a slew of measures taken by the Central government and the RBI to improve investor confidence.</p></div><br />\r\n<div></p><br />\r\nAs per the report, even the future outlook for the next six months has turned pessimistic for the first time since the end of 2013. The sector is under immense pressure. The overall economic slowdown and the slump in domestic consumption</p></div>',	0,	0,	0,	1800,	1,	'2019-10-23 07:52:08',	'2019-10-23 17:42:24'),
