(27,	'5db047fc6e8cb',	7,	21,	'Google touts quantum computing milestone',	'Google touts quantum computing milestone',	'google.jpg',	'https://callupon.orgB',	'Google said it has achieved a breakthrough in quantum computing research, saying an experimental quantum processor has completed a calculation in just a few minutes that would take a traditional supercomputer thousands of years.<br />\r\n<br />\r\nThe findings, published on Wednesday in the scientific journal Nature, show that \"quantum speedup is achievable in a real-world system and is not precluded by any hidden physical laws,\" the researchers wrote.<br />\r\n<br />\r\nQuantum computing is a nascent and somewhat bewildering technology for vastly sped-up information processing. Quantum computers might one day revolutionise tasks that would take existing computers years, including the hunt for new drugs and optimising city and transportation planning.<br />\r\n<br />\r\nThe technique relies on quantum bits, or qubits, which can register data values of zero and one — the language of modern computing — simultaneously. Big tech companies including Google, Microsoft, IBM and Intel are avidly pursuing the technology.<br />\r\n<br />\r\n\"Quantum things can be in multiple places at the same time,\" said Chris Monroe, a University of Maryland physicist who is also the founder of quantum startup IonQ. \"The rules are very simple, they\'re just confounding.\"<br />\r\n<br />\r\nWhat\'s a quantum computer?<br />\r\n<br />\r\nDescribing the inner workings of a quantum computer isn’t easy, even for top scholars. That’s because the machines process information at the scale of elementary particles such as electrons and photons, where different laws of physics apply.<br />\r\n<br />\r\n“It’s never going to be intuitive,” said Seth Lloyd, a mechanical engineering professor at the Massachusetts Institute of Technology. “At this microscopic level, things are weird. An electron can be here and there at the same time, at two places at once.”<br />\r\n<br />\r\nConventional computers process information as a stream of bits, each of which can be either a zero or a one in the binary language of computing. But quantum bits, known as qubits, can register zero and one simultaneously.<br />\r\n<br />\r\nWhat can it do?<br />\r\n<br />\r\nIn theory, the special properties of qubits would allow a quantum computer to perform calculations at far higher speeds than current supercomputers. That makes them good tools for understanding what’s happening in the realms of chemistry, material science or particle physics.<br />\r\n<br />\r\nThat speed could aid in discovering new drugs, optimizing financial portfolios and finding better transportation routes or supply chains. It could also advance another fast-growing field, artificial intelligence, by accelerating a computer’s ability to find patterns in large troves of images and other data.',	0,	0,	0,	25000,	1,	'2019-10-23 12:30:52',	'2019-10-23 18:00:52'),
