(35,	'5db189447c84a',	4,	1,	'Judge Mishra puts the lid on his own recusal issue ',	'text',	'image.jpg',	'http://petition.sheenz.in/J',	'<div><br />\r\n<strong>Justice Mishra was pronouncing his verdict on the question of his own recusal from the Bench.</strong><br />\r\n<p><br />\r\nA judge need not recuse himself from a larger Bench scrutinising the correctness of his own past judgment, a Constitution Bench held in a verdict on Thursday.<br />\r\n</p><br />\r\n<p> “No litigant can choose who should be on the Bench. He cannot say that a judge who might have decided a case on a particular issue, which may go against his interest, should not hear his case as part of a larger Bench,” Justice Arun Mishra wrote in the leading judgment for the Bench. </p><br />\r\n<p> “Rendering a decision on any issue of law cannot be a ground for recusal of a judge; otherwise, no judge can hear a review, curative petition or a reference made to the larger Bench,” the order said. </p><br />\r\n</div><br />\r\n ',	0,	0,	0,	1000,	1,	'2019-10-24 11:21:40',	'2019-10-24 16:51:40'),
(36,	'5db18c9801567',	8,	1,	'Disappointed over NRC being wrongly linked with issue of minority rights: India at UN ',	'Human Rights',	'PAULOMITRIPATHI.jpg',	'http://petition.sheenz.in/K',	'<div><br />\r\n<strong>First Secretary in India’s Permanent Mission to the UN Paulomi Tripath said updating the National Registrar of Citizens (NRC) is a statutory, transparent and legal process mandated and monitored by the Supreme Court of India.</strong><br />\r\n<p> India has voiced disappointment that the NRI linked with the minority rights issue and asserted that one should not jump to conclusions based on “incomplete understanding” after a UN expert raised alarm over a potential “humanitarian crisis” due to the exercise. </p><br />\r\n</div><br />\r\n<div><br />\r\n<p> First Secretary in India’s Permanent Mission to the UN Paulomi Tripath said updating the National Registrar of Citizens (NRC) is a statutory, transparent and legal process mandated and monitored by the Supreme Court of India. </p><br />\r\n<p> “The issue of National Registrar of Citizens in the state of Assam in India is not an issue of rights of minorities. We are disappointed that this issue (is) being wrongly linked with the issue of minority rights. Minorities in India enjoy Constitutional safeguards, which are part of our fundamental rights and which are justiceable,” Tripathi said on Tuesday at a session of the UN General Assembly’s Third Committee (Social, Humanitarian and Cultural). </p><br />\r\n</div>',	0,	0,	0,	5000,	1,	'2019-10-24 11:35:52',	'2019-10-24 17:05:52'),
