(62,	'5de63e1d097be',	2,	28,	'header',	'text',	'pic6.jpeg',	'http://petition.sheenz.in/ba',	'<strong><br />\r\n<strong>Should I kill myself to wake up this system and government? It’s been over 50 days since I last saw my son and I am losing hope. Tarun is a 16 year old autistic child with speech impairment and low vision.</strong><br />\r\n</strong><br />\r\n<p><br />\r\nHe had been playing near a balloon shop near our home in Colaba market, Mumbai on October 1st, 2019. An election rally went past with drums and music and my son got pulled along by the crowd. CCTV footage showed him dancing too. The rally ended near the CST railway station. My son does not even cross a road by himself, I can’t imagine how scared he must be..<br />\r\n</p>',	0,	0,	0,	2,	1,	'2019-12-03 10:51:09',	'2019-12-03 16:21:09'),
